import ascap from "./images/ASCAP.png";
import bmi from "./images/BMI.png";
import gmr from "./images/GMR.png";
import sesac from "./images/SESAC.png";
import hfa from "./images/HFA.png";
import "./PROs.css";

const PROs = () => {
  return (
    <div>
      <h2>ASCAP</h2>
      <img src={ascap} alt="" />
      <h2>BMI</h2>
      <img src={bmi} alt="" />
      <h2>GMR</h2>
      <img src={gmr} alt="" />
      <h2>SESAC</h2>
      <img src={sesac} alt="" />
      <h2>HFA</h2>
      <img src={hfa} alt="" />
    </div>
  );
};

export default PROs;
